const simplifiedArabicBase64 = `data:application/octet-stream;base64,`;

export const addSimplifiedArabicFont = (doc) => {
    // Nombre que usaremos para la fuente en jsPDF
    const fontName = 'Simplified Arabic';

    // Agrega el archivo de la fuente al sistema de archivos virtual de jsPDF
    doc.addFileToVFS(fontName + '.ttf', simplifiedArabicBase64);
    
    // Registra la fuente en jsPDF
    doc.addFont(fontName + '.ttf', fontName, 'normal');

    // Establece la fuente como la fuente activa
    doc.setFont(fontName);
};